(10, 'https://www.exemplo.com/aliviar-estresse-trabalho', 'Este artigo oferece conselhos sobre como reconhecer e gerenciar o estresse no ambiente de trabalho, incluindo técnicas de respiração, práticas de mindfulness e métodos para estabelecer limites saudáveis.', 2022, 'Dr. Ana Torres, Psicóloga e Consultora de Saúde Mental', 33),
(12, 'https://www.exemplo.com/comunicacao-saude-mental', 'O artigo enfatiza a importância de expressar sentimentos, ouvir atentamente e buscar ajuda quando necessário. Ele também fornece dicas sobre como iniciar conversas difíceis relacionadas à saúde mental.', 2021, 'Dra. Sofia Mendes, Psicoterapeuta e Especialista em Comunicação', 34),
(13, 'https://www.exemplo.com/exercicio-saude-mental', ' O artigo examina estudos científicos que demonstram a ligação entre o exercício físico e a saúde mental, além de oferecer dicas práticas para incorporar atividades físicas na rotina diária.', 2020, 'Dr. Pedro Lima, Nutricionista e Pesquisador em Saúde Mental', 35);

